import React, { Component } from 'react';

// Internal Routes
import '../App.scss';

const endpoint = 'http://localhost:8080/api/bananas';

class List extends Component {
  constructor(props) {
    super(props);
  };

render() {
  return (
    <div className="container">
        <div className="employees">
          {
            this.props.allEmployess.length > 0 ? (
              this.props.allEmployees.map(product => {
                return (
                  <Employee
                    key={product.id}
                    id={product.id}
                  />
                )
              })
            ) :
            (<h4> There are no employees</h4>)
          }
          </div>
      </div>
    );
  }
}

export default List;
